import React, { useEffect } from 'react';
import Logo from "../components/Logo";
import Navigation from './Navigation';
import axios from 'axios';
const Countries = () => {

  useEffect(() => {
    axios
    .get("https://restcountries.com/v3")

  }, [])
  return (
    <div className='countries'>
      <Logo/>
      <Navigation/>
      <h1>Countries</h1>
    </div>
  );
};

export default Countries;
